import Classes from './css/Section.module.css'
import Circle from './Circle';

function Section({title, children})
{
    return (
        <div style={{width : '100%'}} className={Classes.smallSection}>
            <h5>{title}</h5>
            <div className={Classes.colors}>
                {children}
            </div>
        </div>
    )
}

export default Section;
